import { ColorModeScript } from "@chakra-ui/react";
import * as React from "react";
import ReactDOM from "react-dom";
import { App } from "./App";
import { theme } from "./styles/theme";

ReactDOM.render(
  <React.StrictMode>
    <ColorModeScript />
    <appProvider>
      <App />
    </appProvider>
  </React.StrictMode>,
  document.getElementById("root")
);
